import React, { Component } from 'react'

class Contacts extends Component {
    constructor(){
        super();
        this.state=[
        {
            id:1,
            name:'John Deoe',
            email:'gmail@gmail.com',
            phone:'555-555-55'
        },
        {
            id:2,
            name:'Chitranjna',
            email:'gmail@gmail.com',
            phone:'999-555-55'
        },
        {
            id:1,
            name:'Manoj',
            email:'gmail@gmail.com',
            phone:'777-555-55'
        }

    ]
    }
    render() {
        const { contacts }  =   this.state;
        return (
            <div>
                {contacts.map(contact=>
                    <h1>{contact.name}</h1>
                )}
            </div>
        )
    }
}

export default Contacts;
